(1, 1, 5, '', 'binus-cloud-computing', 'Binus Cloud Computing', '<h3><strong><em>Dirjen Pembelajaran dan Kemahasiswaan (Belmawa) Kemenristekdikti bekerja sama dengan <a href=\"https://sis.binus.ac.id/2019/07/04/cloud-computing-5/\">CLOUD_BINUS</a> dan Universitas Indonesia (UI)</em></strong><br /><br /></h3>', 'Publish', 'Berita', 'Pastikan perusahaan Anda bisa diakses secara online sehingga meningkatkan brand image perusahaan yang akhirnya meningkatkan omset usaha.', 'Binus.png', 'fa fa-check', 11, 0, NULL, NULL, '2019-05-13 15:51:51', '2020-05-15 15:51:36', '2020-05-26 14:02:14'),
(2, 1, 5, '', 'rapat-bph', 'Rapat BPH', '<p>Rapat BPH pemilihan PIC setiap Divisi Club</p>', 'Publish', 'Layanan', 'Untuk melakukan revisi mengenai kebijakan kebijakan pada Del Cloud Club,BPH akan mengadakan rapat dengan Kordinator pembina,demi menyelaraskan pesan dan kesan member untuk kemajuan Club', 'iconDCC13.png', 'fa fa-check', 46, 0, NULL, NULL, '2019-05-17 04:15:33', '2019-05-17 04:06:15', '2020-05-29 13:44:29'),
(3, 1, 5, '', 'seleksi-team', 'Seleksi Team', '<h2>Rules</h2>\r\n<p>&nbsp;Setiap akan melakukan seleksi denga seluruh anggota,team yang masuk 5besar akan maju untuk kompetisi</p>', 'Publish', 'Layanan', 'Cloud Computing ITB,Untuk membantu para IT Generation memahami lebih dalam tentang Cloud Computing.Seleksi Team Del Cloud Club ', 'iconDCC12.png', 'fa fa-globe', 7, 2, NULL, NULL, '2019-05-17 04:37:00', '2020-05-15 04:36:19', '2020-05-25 09:53:55'),
(4, 1, 5, '', 'profil-cloud-club-del', 'Profil Cloud CLub Del', '<p>Cloud Club Del merupakan salah satu UKM IT Del,yang bergerak dibidang Cloud Computing.UKM ini berfokus pada Cloud Computing dan membahas seputar Kompetisi dan Sistem dari Cloud sendiri.</p>', 'Publish', 'Profil', '', 'iconDCC1.png', '', 21, 1, NULL, NULL, '2019-07-26 10:38:15', '2019-07-26 10:36:47', '2020-05-28 07:53:51'),
(6, 1, 5, '', 'sharing-session-diskusi-bph', 'Sharing Session Diskusi BPH', '<p>Dalam Rangka Cloud Computing yang akan Diadakan di Del Institut Of Technologie,Maka DCC akan bekerja sama denga Bem IT Del.Maka dari itu,BPH akan mengadakan Rapat untuk memperbincang beberapa topik dan skema Alur kerja Persiapan yang dilakukan.</p>', 'Publish', 'Layanan', 'BPH Del Cloud Club akan mengadakan Sharing Session dengan member,yang di pimpin langsung oleh kordinator pembina Del Cloud Club.', 'iconDCC11.png', 'fa fa-mobile', 14, 0, NULL, NULL, '2020-02-13 07:42:56', '2020-05-20 07:41:51', '2020-05-25 21:36:00'),
(7, 1, 5, '', 'nation-competition-cloud-computing-amazon', 'Nation Competition Cloud Computing Amazon', '<p><strong><em>Dirjen Pembelajaran dan Kemahasiswaan (Belmawa) Kemenristekdikti bekerja sama dengan&nbsp;<a href=\"https://aws.amazon.com/\">Amazon Web Service (AWS)</a>&nbsp;dan Universitas Indonesia (UI)</em></strong></p>', 'Publish', 'Berita', 'Aplikasi bisnis berbasis web? Situs pendaftaran online untuk menunjang bisnis Anda? Kami berpengalaman dalam merencanakan & mengembangkan aplikasi tersebut.', 'amazon.jpg', 'fa fa-check', 3, 0, NULL, NULL, '2020-02-13 07:45:07', '2020-05-14 07:44:27', '2020-05-25 21:47:15'),
(8, 1, 5, '', 'cloud-computing-itb-2020', 'Cloud Computing ITB 2020', '<p>Rekan Rekan Anggota Del CLoud Club,berhubung Cloud Computing ITB 2020 akan berlangsung di minggu dekat,maka BPH yang sebelumnya sudah melakukan Rapat untuk pengambilan keputusan.Adapun Kesimpulan yang diambil,akan dilakukan seleksi terhadap team yang akan maju nantinya,maka dari itu,dibuka pendaftaran untuk seleksi pada team yang akan maju.Untuk Detailnya,dapat di unduh di &lt;a href=\"download\"&gt;Disini</p>', 'Publish', 'Berita', '', 'Layanan1.png', 'fa fa-check', 7, 0, NULL, NULL, '2020-05-14 23:44:22', '2020-05-14 23:39:17', '2020-05-25 21:47:01'),
(9, 1, 5, '', 'rapat-panitia', 'Rapat Panitia', '<p>Rapat Mengenai Cloud Computing</p>', 'Publish', 'Berita', '', NULL, 'fa fa-check', 0, 0, NULL, NULL, '2020-05-17 18:57:46', '2020-05-17 18:56:28', '2020-05-17 11:57:46'),
